import React from 'react';
import { ThreeDots } from 'react-loader-spinner';

const Loader = () => (
    <div style={{ display: 'flex', justifyContent: 'center', marginTop: '40px' }}>
        <ThreeDots
            height="60"
            width="60"
            radius="9"
            color="#3498db"
            ariaLabel="loading"
        />
    </div>
);

export default Loader;
